import React from "react";
import { useEffect, useRef, useState } from "react";
import { useLocation, useHistory } from "react-router-dom";
import Modal from "../components/Modal";
import Layout from "../components/Layout";
import Editorr from "../components/CKEditor";
import { getNote, deleteNote, updateNote } from "../apiCalls/notesApi";
import { validInput } from "../utils/validation";
const AUTOSAVE_INTERVAL = 1000;

const Note = () => {
  const location = useLocation();
  const id = location.pathname.split("/")[2];

  const [note, setNote] = useState();
  const [title, setTitle] = useState("");
  const [body, setBody] = useState("");
  const [savedTitle, setSavedTitle] = useState("");
  const [savedBody, setSavedBody] = useState("");

  const [shareMenu, setShareMenu] = useState(false);
  const [email, setEmail] = useState("");
  const [deleteAction, setDeleteAction] = useState(false);
  const [deleteModal, setDeleteModal] = useState(false);
  //const [author, setAuthor] = useState<UserRole | null>(null)
  const [authenticated, setAuthenticated] = useState(false);
  const history = useHistory();

  const deleteNoteHandler = () => {
    setDeleteModal(true);
  };

  useEffect(() => {
    refreshNote(id);
  }, [id]);

  const refreshNote = (id) => {
    getNote(id)
      .then((res) => {
        setNote(res);
      })
      .catch((err) => {
        alert(err);
      });
  };

  useEffect(() => {
    if (deleteAction) {
      deleteNote(note.id).then((res) => {
        history.push("/workspace");
      });
    }
  }, [deleteAction]);

  useEffect(() => {
    if (note) {
      setBody(note.body);
      setTitle(note.title);
    }
  }, [note]);

  useEffect(() => {
    const timer = setTimeout(() => {
      if ((savedTitle !== title && validInput(title)) || savedBody !== body) {
        updateNote(id, body, title).then((res) => {
          setSavedBody(body);
          setSavedTitle(title);
        });
      }
    }, AUTOSAVE_INTERVAL);
    return () => clearTimeout(timer);
  }, [title, body]);

  return (
    <Layout>
      <div className="w-full mx-auto mt-12 md:max-w-6xl">
        {deleteModal && (
          <Modal
            title="Are you sure you want to delete the note?"
            actionValue={deleteAction}
            setActionValue={setDeleteAction}
            action="Delete"
            variant="error"
            body="Are you sure you want to delete your note. This
          action cannot be undone."
            setModal={setDeleteModal}
          />
        )}
        <nav className="h-18">
          <ul className="flex float-right mt-5  text-sm">
            <li>
              <button
                className="flex  
                 float-right bg-color mr-4 px-3 py-1 right cursor-pointer text-white bg-gray-500 hover:bg-purple-800 transform hover:scale-10 transition-all "
                //onClick={deleteFolderHandler}
              >
                Share
              </button>
            </li>
            <li>
            <div class="p-10">

<div className="dropdown inline-block relative">
  <button className="bg-gray-300 text-gray-700 font-semibold py-2 px-4 rounded inline-flex items-center">
    <span className="mr-1">Dropdown</span>
    <svg class="fill-current h-4 w-4" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20"><path d="M9.293 12.95l.707.707L15.657 8l-1.414-1.414L10 10.828 5.757 6.586 4.343 8z"/> </svg>
  </button>
  <ul class="dropdown-menu absolute hidden text-gray-700 pt-1">
    <li><input class=" inline-block rounded-t bg-gray-200 hover:bg-gray-400 py-2 px-4 block whitespace-no-wrap" href="#" placeholder="Write user name"/></li>
  <li> <button class=" inline-block" type="submit">
    fgbn
    </button> </li>
  </ul>
</div>

</div>
            </li>
            <li>
              <button
                className="flex float-right bg-color ml-4 px-3 py-1 right cursor-pointer text-white bg-gray-500 hover:bg-purple-800 transform hover:scale-10 transition-all"
                onClick={deleteNoteHandler}
              >
                Delete
              </button>
            </li>
          </ul>
        </nav>
        <input
          type="text"
          value={title}
          maxLength={64}
          className="block w-full text-4xl font-bold outline-none text-primary-default"
          onChange={(e) => setTitle(e.target.value)}
        />
        <Editorr body={body} setBody={setBody} />
      </div>
    </Layout>
  );
};

export default Note;
